/** @jsx jsx */
import { css, jsx } from '@emotion/core';

const Grid = ({ children }) => {
  return (
    <section
      css={css`
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
      `}>
      {children}
    </section>
  );
};

export default Grid;
